import { commonrequest } from "./ApiCall";
import { BASE_URL } from "./helper";

// Register doctor function
export const registerDoctor = async (data, header) => {
  return await commonrequest(
    "POST",
    `${BASE_URL}/doctor/register`,
    data,
    header
  );
};
